rals (This contribution would be made on behalf of anyone that is making deferral contributions to the Plan.)\n\n-or-\n\n     Safe Harbor Non-Elective: 3% of Compensation (This contribution would be made to anyone who has met eligibility regardless of whether or not they are making deferral contributions to the Plan.)\n\nApplies to all employees\n\nNote: Annual contribution", "column_3": "", "column_4": ""}, {"column_1": "ADP / ACP Testing Method", "column_2": "N/A if Safe Harbor plan design is selected\n\nCurrent year method for ADP/ACP if this will be a non-Safe Harbor plan design", "column_3": "", "column_4": ""}], "addons": {"after": "", "before": ""}, "canAdd": false, "format": "", "colWrap": false, "columns": {"label": 12, "wrapper": "12", "container": 12}, "presets": ["matrix-table"], "rowWrap": false, "disabled": false, "readonly": false, "canRemove": false, "conditions": [], "stickyCols": false, "stickyRows": false, "description": "", "elementName": "Single Choice Matrix", "elementType": "matrix", "isMandatory": false, "hideColLabels": false, "hideRowLabels": false, "classification": "STANDARD", "dataDictFieldUI": {"id": null, "label": null, "fieldName": null, "defaultValue": null, "possibleValues": null, "dataDictionaryId": null, "fieldValueFormat": null}}], "is_mandatory_not_filled": false}, {"is_saved": false, "page_name": "page3", "section_name": "D - Contributions - Employer Matching", "form_elements": [{"tag": "h2", "top": "", "name": "h2", "size": "", "type": "h2", "align": "left", "rules": [], "addons": {"after": "", "before": ""}, "bottom": "", "format": "", "columns": {"label": 12, "wrapper": "", "container": 12}, "content": "D - Contributions - Employer Matching", "conditions": [], "description": "", "elementName": "Section heading", "elementType": "TEXT", "isMandatory": false, "classification": "STANDARD", "dataDictFieldUI": {"id": null, "label": null, "fieldName": null, "defaultValue": null, "possibleValues": null, "dataDictionaryId": null, "fi