s</li><li>Empower will complete all participant tax reporting only for distributions processed by us</li><li>Empower will need to be apprised of any subsequent plan document amendments to the Plan</li><li>The client will have full access to Plan Service Center which will allow contribution remittances, loan distributions, view plan and participant information, etc.</li></ul>", "conditions": [], "description": "", "elementName": "Paragraph", "elementType": "TEXT", "isMandatory": false, "classification": "STANDARD", "questionPartUI": {}, "dataDictFieldUI": {}}, {"name": "container", "size": "", "type": "group", "label": "", "rules": [], "addons": {"after": "", "before": ""}, "format": "", "columns": {"label": 3, "wrapper": "", "container": 12}, "children": [{"name": "signature", "size": "", "type": "signature", "label": "Signature", "rules": [], "value": "", "format": "", "height": "160", "accepts": ["jpg", "png", "svg"], "columns": {"label": 12, "wrapper": "", "container": 6}, "maxSize": "2048", "disabled": false, "maxWidth": "", "readonly": false, "conditions": [], "description": "", "elementName": "Signature", "elementType": "TEXT", "isMandatory": false, "placeholder": "Sign here", "classification": "STANDARD", "questionPartUI": {}, "dataDictFieldUI": {}}, {"top": "", "name": "spacer", "type": "spacer", "rules": [], "bottom": "", "columns": {"label": 12, "wrapper": "", "container": 3}, "content": "&nbsp;", "conditions": [], "elementName": "Spacer"}, {"max": "", "min": "", "name": "date", "size": "", "type": "date", "label": "Date", "rules": [], "value": "", "addons": {"after": "", "before": ""}, "format": "", "columns": {"label": 12, "wrapper": "", "container": 3}, "disabled": false, "readonly": false, "conditions": [], "description": "", "elementName": "Date", "elementType": "TEXT", "isMandatory": false, "placeholder": "", "valueFormat": "MM/DD/YYYY", "displayFormat": "MM/DD/YYYY", "classification": "STANDARD", "questionPartUI": {}, "dataDictFieldUI": {}}], "disabled": false, "readonly": false, "conditions": [], "description": "", "elementName": "Group", "elementType": "TEXT", "isMandatory": false, "classification": "STANDARD", "questionPartUI": {}, "dataDictFieldUI": {}}, {"tag": "p", "top": "", "name": "p_1", "size": "", "type": "p", "align": "left", "rules": [], "addons": {"after": "", "before": ""}, "bottom": "", "format": "", "columns": {"label": 12, "wrapper": "", "container": 12}, "content": "<p>The Payment Authorization Service will be provided at no cost to the Plan Sponsor or the plan participants.</p><p><br></p><p><strong>By signing below, you (“Authorized Plan Representative”) acknowledge and agree that:</strong></p><p><br></p><p>1. You are authorized to sign on behalf of the Plan.</p><p>2. You have determined that engaging the services of the Payee for a fee is permissible under applicable law,</p><p>including U.S. Department of Labor guidance, any State usury laws, and the organizational documents of</p><p>the Plan.</p><p>3. You have determined that the expenses for which they are requesting payment via this form are eligible</p><p>Plan expenses that may be paid from Plan assets and that such expenses are reasonable.</p><p>4. If the fee requested is a new fee or a change to a prior fee, you certify that all participants have received</p><p>notice of the fee as required in the participant fee disclosure regulations, the Employee Retirement Income</p><p>Security Act of 1974 (ERISA) Regulation Section 404(a)-5</p><p>5. In the event that a requested payment is to be made to a Registered Investment Advisor (“RIA”) directly,</p><p>instead of the RIA firm, you have determined that such direct payment is permissible.</p><p>6. That Empower is acting solely at your direction as a remittance or paying agent, and has not performed</p><p>any due diligence on any Payee, negotiated the terms of the Payee’s compensation, or advised on the</p><p>means or manner of remitting the Payee’s compensation.</p><p>7. On behalf of the Plan, you agree to hold Empower, its affiliates, and the officers, directors, and employees</p><p>of Empower and its affiliates harmless from any and all liability that may arise out of or is the result of any</p><p>of the Payee’s activities, or the remittance of any compensation to the Payee unless we have acted with</p><p>gross negligence or in bad faith in remitting such compensation to the Payee.</p><p>8. You may terminate this Authorization at any time by notifying Empower in writing prior to the time that a</p><p>payment is processed. Any termination of this Payment Authorization will not be effective until written</p><p>notification is received at the address listed below. Empower is entitled to rely on this authorization and is</p><p>released from liability for any payments made pursuant to it.</p><p><br></p><p>Empower Partner Services Contact Information:</p><p><br></p><p>Email: PartnerServices@empower.com Mail / Fax to: Empower Financial ATTN: Partner Services</p><p>8515 East Orchard Road 8T2 Greenwood Village, CO 80111 (303) 737-1499</p><p><br></p><p>Signed via Agreements/Services Signature Page</p><p>Authorized Plan Representative Signature</p>", "conditions": [], "description": "", "elementName": "Paragraph", "elementType": "TEXT", "isMandatory": false, "classification": "STANDARD", "questionPartUI": {}, "dataDictFieldUI": {}}], "is_mandatory_not_filled": null}], "is_submitted": false}', '/data/singlepoint-ai-data/questionnaire-templates/EmpowerRKFormTemplate.docx', 1, 6);
