tType": "TEXT", "isMandatory": false, "placeholder": "Legal Plan Name", "classification": "STANDARD", "questionPartUI": {}, "dataDictFieldUI": {"id": 14, "label": "Legal Plan Name", "fieldName": "LEGAL_PLAN_NAME", "defaultValue": null, "possibleValues": null, "dataDictionaryId": 1, "fieldValueFormat": null}}, {"max": "", "min": "", "name": "date_1", "size": "", "type": "date", "label": "Design Session Date", "rules": [], "value": "", "addons": {"after": "", "before": ""}, "format": "", "columns": {"label": 6, "wrapper": 3, "container": 12}, "disabled": false, "readonly": false, "conditions": [], "description": "", "elementName": "Date", "elementType": "TEXT", "isMandatory": false, "placeholder": "", "valueFormat": "MM/DD/YYYY", "displayFormat": "DD/MM/YYYY", "classification": "STANDARD", "questionPartUI": {}, "dataDictFieldUI": {}}, {"name": "textarea_1", "size": "", "type": "textarea", "label": "Design Session Participants", "rules": [], "value": "", "addons": {"after": "", "before": ""}, "format": "", "columns": {"label": 12, "wrapper": "", "container": 12}, "disabled": false, "readonly": false, "conditions": [], "description": "", "elementName": "Multiline text", "elementType": "TEXT", "isMandatory": false, "placeholder": "", "classification": "STANDARD", "questionPartUI": {}, "dataDictFieldUI": {}}, {"cols": [{"label": "Plan Information", "value": "column_1", "inputType": {"type": "textarea"}}, {"label": "Recommendations", "value": "column_2", "inputType": {"type": "textarea"}}, {"label": "Call Notes", "value": "column_3", "inputType": {"type": "textarea"}}, {"label": "Final Design", "value": "column_4", "inputType": {"type": "textarea"}}], "name": "matrix_0", "rows": 4, "size": "", "type": "matrix", "label": "", "rules": [], "value": [{"column_1": "A - Plan Name/Effective Date", "column_2": "The plan, identified as \"ZZZ Templates Cycle 3 - Default Plan\" with the plan number 001, was established on January 1, 2022. The plan year is defined as a consecutive 12-month period ending on December 31, aligning with the calendar year. The limitation year is the same as the plan year.", "column_3": "", "column_4": ""}, {"column_1": "A - Plan Features", "column_2": "The plan allows for elective deferrals and Roth elective deferrals but does not permit voluntary (after-tax) contributions. Employer matching contributions, non-elective contributions, and safe harbor contributions are all permitted under the plan. These features are outlined in sections 4.01 to 4.04 of the plan.", "column_3": "", "column_4": ""}, {"column_1": "A - Compensation", "column_2": "The subsection defines \"Statutory Compensation\" to include W-2 compensation and post-severance compensation. For \"Plan Compensation\" purposes, allocations will be based on Statutory Compensation with exclusions limited to elective deferrals, employer match, and non-elective contributions. Exclusions include pay earned before participation and amounts contributed by the employer under specific tax code sections. Plan Compensation is determined over the Plan Year ", "column_3": "", "column_4": ""}, {"column_1": "A - Definitions", "column_2": "The \"Disability\" definition outlines that a participant is considered disabled if they cannot perform any substantial gainful activity due to a physical or mental impairment expected to last at least 12 months or result in death, with medical evidence required to support the claim. The choice of law for this plan is governed by the state of Delaware.", "column_3": "", "column_4": ""}], "addons": {"after": "", "before": ""}, "canAdd": false, "format": "", "colWrap": false, "columns": {"label": 12, "wrapper": "12", "container": 12}, "presets": ["matrix-table"], "rowWrap": false, "disabled": false, "readonly": false, "canRemove": false, "conditions": [], "stickyCols": false, "stickyRows": false, "description": "", "elementName": "Single Choice Matrix", "elementType": "matrix", "isMandatory": false, "hideColLabels": false, "hideRowLabels": false, "classification": "STANDARD", "dataDictFieldUI": {"id": null, "label": null, "fieldName": null, "defaultValue": null, "possibleValues": null, "dataDictionaryId": null, "fieldValueFormat": null}}], "is_mandatory_not_filled": false}, {"is_saved": false, "page_name": "page1", "section_name": "B - Eligibility", "form_elements": [{"tag": "h2", "top": "", "name": "h2", "size": "", "type": "h2", "align": "left", "rules": [], "addons": {"after": "", "before": ""}, "bottom": "", "format": "", "columns": {"label": 12, "wrapper": "", "container": 12}, "content": "B - Eligibility", "conditions": [], "description": "", "elementName": "Section heading", "elementType": "TEXT", "isMandatory": false, "classification": "STANDARD", "dataDictFieldUI": {"id": null, "label": null, "fieldName": null, "defaultValue": null, "possibleValues": null, "dataDictionaryId": null, "fieldValueFormat": null}}, {"cols": [{"label": "Plan Information", "value": "column_1", "inputType": {"type": "textarea"}}, {"label": "Recommendations", "value": "column_2", "inputType": {"type": "textarea"}}, {"label": "Call Notes", "value": "column_3", "inputType": {"type": "textarea"}}, {"label": "Final Design", "value": "column_4", "inputType": {"type": "textarea"}}], "name": "matrix_1", "rows": 3, "size": "", "type": "matrix", "label": "", "rules": [], "value": [{"column_1": "B - Exclusions", "column_2": "The \"Eligible Employee\" designation excludes union employees, leased employees, and non-resident aliens from participating in elective deferrals, employer match, and non-elective contributions. Additionally, employees can irrevocably opt-out of the plan as per Treas. Reg. section 1.401(k)-1(a)(3)(v).", "column_3": "", "column_4": ""}, {"column_1": "B - Eligibility Service Rules", "column_2": "Break in Service: Rule of parity; exclude eligibility service before a period of five consecutive One‑Year Breaks in Service/Periods of Severance if an Employee does not have any nonforfeitable right to the Account balance derived from Employer contributions ", "column_3": "", "column_4": ""}, {"column_1": "B - Eligibility for Plan Participation", "column_2": "Employees must be at least 21 years old to participate in elective deferrals, employer matching, and non-elective contributions. To be eligible, employees must complete one year of service, defined as at least 1,000 hours of service within that year. Participation in elective deferrals, employer matching, and non-elective contributions begins on the first day of the calendar month following the completion of the eligibility requirements. Employees become participants on the entry date that coincides with or follows the date they meet the eligibility requirements. The eligibility computation period is based on the plan year, with no specific hours equivalency for eligibility purposes.", "column_3": "", "column_4": ""}], "addons": {"after": "", "before": ""}, "canAdd": false, "format": "", "colWrap": false, "columns": {"label": 12, "wrapper": "12", "container": 12}, "presets": ["matrix-table"], "rowWrap": false, "disabled": false, "readonly": false, "canRemove": false, "conditions": [], "stickyCols": false, "stickyRows": false, "description": "", "elementName": "Single Choice Matrix", "elementType": "matrix", "isMandatory": false, "hideColLabels": false, "hideRowLabels": false, "classification": "STANDARD", "dataDictFieldUI": {"id": null, "label": null, "fieldName": null, "defaultValue": null, "possibleValues": null, "dataDictionaryId": null, "fieldValueFormat": null}}], "is_mandatory_not_filled": false}, {"is_saved": false, "page_name": "page2", "section_name": "C - Contributions - Elective Deferrals", "form_elements": [{"tag": "h2", "top": "", "name": "h2", "size": "", "type": "h2", "align": "left", "rules": [], "addons": {"after": "", "before": ""}, "bottom": "", "format": "", "columns": {"label": 12, "wrapper": "", "container": 12}, "content": "C - Contributions - Elective Deferrals", "conditions": [], "description": "", "elementName": "Section heading", "elementType": "TEXT", "isMandatory": false, "classification": "STANDARD", "dataDictFieldUI": {"id": null, "label": null, "fieldName": null, "defaultValue": null, "possibleValues": null, "dataDictionaryId": null, "fieldValueFormat": null}}, {"cols": [{"label": "Plan Information", "value": "column_1", "inputType": {"type": "textarea"}}, {"label": "Recommendations", "value": "column_2", "inputType": {"type": "textarea"}}, {"label": "Call Notes", "value": "column_3", "inputType": {"type": "textarea"}}, {"label": "Final Design", "value": "column_4", "inputType": {"type": "textarea"}}], "name": "matrix_2", "rows": 4, "size": "", "type": "matrix", "label": "", "rules": [], "value": [{"column_1": "C - Elective Deferrals", "column_2": "Participants can start, modify, or stop elective deferrals at any time, with no minimum deferral amount and the maximum deferral limited by IRS Section 415. Catch-up contributions are permitted as per Section 5.01(d). Modifications can be made on a per-pay-period basis. Participants can also stop their contributions at any time.", "column_3": "", "column_4": ""}, {"column_1": "C - Automatic Enrollment", "column_2": "The Plan includes Automatic Enrollment provisions to comply with the EACA. All employees without an existing election or with an election below the automatic enrollment amount are subject to these provisions. The initial automatic enrollment amount is 3% of pay, increasing by 1% annually until it reaches a maximum of 10%. The first deferral rate increase occurs on the first day of the second Plan Year following the initial enrollment, with subsequent increases on the first day of each Plan Year. Employees can withdraw contributions within 90 days after the first automatic deferral. Automatic contributions default to pre-tax.", "column_3": "", "column_4": ""}, {"column_1": "C - Safe Harbor Contributions", "column_2": "This subsection outlines the plan''s safe harbor contributions, confirming it is a safe harbor plan exempt from most testing, specifically satisfying ADP and ACP safe harbor rules. It includes no exclusions for safe harbor eligibility, and safe harbor conditions follow those for elective deferrals. Plan compensation for safe harbor contributions includes pay earned before participation. The safe harbor matching contribution formula consists of two rates: 100% match on the first 3% of compensation and 50% match on the next 2% (up to 5% total). Contributions are determined on a per pay period basis.", "column_3": "", "column_4": ""}, {"column_1": "C - Testing Elections", "column_2": "The ADP Testing Elections (Section 5.02(a)) for the average deferral percentage of nonhighly compensated employees are based on the current year. Similarly, the ACP Testing Elections (Section 5.02(b)) for the average contribution percentage of nonhighly compensated employees are also determined using the current year.", "column_3": "", "column_4": ""}], "addons": {"after": "", "before": ""}, "canAdd": false, "format": "", "colWrap": false, "columns": {"label": 12, "wrapper": "12", "container": 12}, "presets": ["matrix-table"], "rowWrap": false, "disabled": false, "readonly": false, "canRemove": false, "conditions": [], "stickyCols": false, "stickyRows": false, "description": "", "elementName": "Single Choice Matrix", "elementType": "matrix", "isMandatory": false, "hideColLabels": false, "hideRowLabels": false, "classification": "STANDARD", "dataDictFieldUI": {"id": null, "label": null, "fieldName": null, "defaultValue": null, "possibleValues": null, "dataDictionaryId": null, "fieldValueFormat": null}}], "is_mandatory_not_filled": false}, {"is_saved": false, "page_name": "page3", "section_name": "D - Contributions - Employer Matching", "form_elements": [{"tag": "h2", "top": "", "name": "h2", "size": "", "type": "h2", "align": "left", "rules": [], "addons": {"after": "", "before": ""}, "bottom": "", "format": "", "columns": {"label": 12, "wrapper": "", "container": 12}, "content": "D - Contributions - Employer Matching", "conditions": [], "description": "", "elementName": "Section heading", "elementType": "TEXT", "isMandatory": false, "classification": "STANDARD", "dataDictFieldUI": {"id": null, "label": null, "fieldName": null, "defaultValue": null, "possibleValues": null, "dataDictionaryId": null, "fieldValueFormat": null}}, {"cols": [{"label": "Plan Information", "value": "column_1", "inputType": {"type": "textarea"}}, {"label": "Recommendations", "value": "column_2", "inputType": {"type": "textarea"}}, {"label": "Call Notes", "value": "column_3", "inputType": {"type": "textarea"}}, {"label": "Final Design", "value": "column_4", "inputType": {"type": "textarea"}}], "name": "matrix_3", "rows": 5, "size": "", "type": "matrix", "label": "", "rules": [], "value": [{"column_1": "D - Employer Matching - Allocation Service", "column_2": "Participants must be employed by the employer on the last day of the plan year to share in employer matching contributions. If a participant''s employment ends on the last day of the plan year, they are considered employed for allocation purposes. In case of coverage failures under Section 410(b), the employer must add enough participants to meet the required ratio.", "column_3": "", "column_4": ""}, {"column_1": "D - Employer Matching - Formula", "column_2": "The employer matching contribution includes both participant catch-up contributions and Roth elective deferrals. The matching formula is a discretionary uniform percentage of the matched employee contributions. The employer''s match is capped at 4% of the participant''s compensation, with the match limited to the first 6% of compensation deferred. The determination of the matching contribution occurs at the end of the plan year.", "column_3": "", "column_4": ""}, {"column_1": "D - Non-Elective - Allocation Service", "column_2": "In this subsection, an eligible employee receives non-elective contributions upon meeting specific criteria. To qualify, employees must complete at least 1,000 hours of service in a plan year and be employed on the last day of the plan year. The allocation service computation does not use hours equivalency. Exceptions are made for employees whose employment ends on the last day of the plan year. Coverage failures are addressed by adding participants to meet the required ratio.", "column_3": "", "column_4": ""}, {"column_1": "D - Non-Elective - Formula", "column_2": "The Non-Elective Contributions are discretionary and determined by the Employer. These contributions are allocated to eligible participants who meet specific criteria outlined in Section B and D.14 to 17. The allocation follows a \"New Comparability - One Group per Participant\" formula, where each eligible participant forms a separate group. The Employer designates the contribution amount for each group, which does not need to be related to other groups'' contributions. The Employer must notify the Plan Administrator or Trustee in writing of the contributions allocated to each group. The determination period for these contributions is at the end of the Plan Year.", "column_3": "", "column_4": ""}, {"column_1": "D - Other Contributions/415", "column_2": "Rollovers: Rollover Contributions are permitted; all Eligible Employees may make a Rollover Contribution even if not yet a Participant. Death or Disability During Qualified Military Service: For benefit accrual, a Participant who dies or becomes Disabled while in qualified military service is treated as if employed on the day preceding death/Disability and terminated on the day of death/Disability", "column_3": "", "column_4": ""}], "addons": {"after": "", "before": ""}, "canAdd": false, "format": "", "colWrap": false, "columns": {"label": 12, "wrapper": "12", "container": 12}, "presets": ["matrix-table"], "rowWrap": false, "disabled": false, "readonly": false, "canRemove": false, "conditions": [], "stickyCols": false, "stickyRows": false, "description": "", "elementName": "Single Choice Matrix", "elementType": "matrix", "isMandatory": false, "hideColLabels": false, "hideRowLabels": false, "classification": "STANDARD", "dataDictFieldUI": {"id": null, "label": null, "fieldName": null, "defaultValue": null, "possibleValues": null, "dataDictionaryId": null, "fieldValueFormat": null}}], "is_mandatory_not_filled": false}, {"is_saved": false, "page_name": "page4", "section_name": "E - Vesting", "form_elements": [{"tag": "h2", "top": "", "name": "h2", "size": "", "type": "h2", "align": "left", "rules": [], "addons": {"after": "", "before": ""}, "bottom": "", "format": "", "columns": {"label": 12, "wrapper": "", "container": 12}, "content": "E - Vesting", "conditions": [], "description": "", "elementName": "Section heading", "elementType": "TEXT", "isMandatory": false, "classification": "STANDARD", "dataDictFieldUI": {"id": null, "label": null, "fieldName": null, "defaultValue": null, "possibleValues": null, "dataDictionaryId": null, "fieldValueFormat": null}}, {"cols": [{"label": "Plan Information", "value": "column_1", "inputType": {"type": "textarea"}}, {"label": "Recommendations", "value": "column_2", "inputType": {"type": "textarea"}}, {"label": "Call Notes", "value": "column_3", "inputType": {"type": "textarea"}}, {"label": "Final Design", "value": "column_4", "inputType": {"type": "textarea"}}], "name": "matrix_4", "rows": 2, "size": "", "type": "matrix", "label": "", "rules": [], "value": [{"column_1": "E - Vesting Service Rules", "column_2": "The plan''s vesting service rules are based on hours of service, with 1,000 hours required for a year of vesting service. No equivalencies for vesting purposes are selected. Vesting is computed on a plan year basis. Exceptions include full vesting upon death or disability of the participant.", "column_3": "", "column_4": ""}, {"column_1": "E - Vesting Schedules", "column_2": "The plan utilizes a 2-6 year graded vesting schedule for both employer matching and non-elective contributions. Forfeitures can be allocated using any permissible method as described in Section 6.03(d). ", "column_3": "", "column_4": ""}], "addons": {"after": "", "before": ""}, "canAdd": false, "format": "", "colWrap": false, "columns": {"label": 12, "wrapper": "12", "container": 12}, "presets": ["matrix-table"], "rowWrap": false, "disabled": false, "readonly": false, "canRemove": false, "conditions": [], "stickyCols": false, "stickyRows": false, "description": "", "elementName": "Single Choice Matrix", "elementType": "matrix", "isMandatory": false, "hideColLabels": false, "hideRowLabels": false, "classification": "STANDARD", "dataDictFieldUI": {"id": null, "label": null, "fieldName": null, "defaultValue": null, "possibleValues": null, "dataDictionaryId": null, "fieldValueFormat": null}}], "is_mandatory_not_filled": false}, {"is_saved": false, "page_name": "page5", "section_name": "F - Distributions", "form_elements": [{"tag": "h2", "top": "", "name": "h2", "size": "", "type": "h2", "align": "left", "rules": [], "addons": {"after": "", "before": ""}, "bottom": "", "format": "", "columns": {"label": 12, "wrapper": "", "container": 12}, "content": "F - Distributions", "conditions": [], "description": "", "elementName": "Section heading", "elementType": "TEXT", "isMandatory": false, "classification": "STANDARD", "dataDictFieldUI": {"id": null, "label": null, "fieldName": null, "defaultValue": null, "possibleValues": null, "dataDictionaryId": null, "fieldValueFormat": null}}, {"cols": [{"label": "Plan Information", "value": "column_1", "inputType": {"type": "textarea"}}, {"label": "Recommendations", "value": "column_2", "inputType": {"type": "textarea"}}, {"label": "Call Notes", "value": "column_3", "inputType": {"type": "textarea"}}, {"label": "Final Design", "value": "column_4", "inputType": {"type": "textarea"}}], "name": "matrix_5", "rows": 5, "size": "", "type": "matrix", "label": "", "rules": [], "value": [{"column_1": "F - Normal/Early Retirement", "column_2": "Normal Retirement Age: 65; Normal Retirement Date is upon attainment of age 65. Early Retirement Age: None – the Plan does not have an early retirement feature", "column_3": "", "column_4": ""}, {"column_1": "F - Time & Form of Payment", "column_2": "Distributions upon termination of employment, excluding death, will be made immediately in cash as a lump sum. Participants cannot elect annuity payments, and beneficiaries also do not have the option for annuity distributions. Partial or installment distributions are only allowed to meet required minimum distribution rules. The default form of payment is a lump sum.", "column_3": "", "column_4": ""}, {"column_1": "F - Payments on Death", "column_2": "Payment upon Participant''s Death: Entire Account balance is paid by the end of the fifth year. Beneficiaries: In the absence of a designated beneficiary, payments follow Section 7.04(c); a spouse’s beneficiary designation is automatically revoked upon legal divorce", "column_3": "", "column_4": ""}, {"column_1": "F - Force-Out Provisions", "column_2": "The force-out provisions specify a maximum force-out amount of $5,000 under Section 7.03. Force-outs exceeding $1,000 are subject to automatic rollover provisions outlined in Section 7.06(c). The force-out of a terminated participant''s account balance is deferred until the Required Beginning Date, at which point it must be paid in a lump sum.", "column_3": "", "column_4": ""}, {"column_1": "F - Required Beginning Date", "column_2": "The Required Beginning Date for a participant who is not a More Than 5% Owner is April 1 of the calendar year following the later of the year in which the participant turns 70-1/2 years old or the year in which they retire. This specifies when distributions must begin. No other options were selected.", "column_3": "", "column_4": ""}], "addons": {"after": "", "before": ""}, "canAdd": false, "format": "", "colWrap": false, "columns": {"label": 12, "wrapper": "12", "container": 12}, "presets": ["matrix-table"], "rowWrap": false, "disabled": false, "readonly": false, "canRemove": false, "conditions": [], "stickyCols": false, "stickyRows": false, "description": "", "elementName": "Single Choice Matrix", "elementType": "matrix", "isMandatory": false, "hideColLabels": false, "hideRowLabels": false, "classification": "STANDARD", "dataDictFieldUI": {"id": null, "label": null, "fieldName": null, "defaultValue": null, "possibleValues": null, "dataDictionaryId": null, "fieldValueFormat": null}}], "is_mandatory_not_filled": false}, {"is_saved": false, "page_name": "page6", "section_name": "G - In-service Withdrawals", "form_elements": [{"tag": "h2", "top": "", "name": "h2", "size": "", "type": "h2", "align": "left", "rules": [], "addons": {"after": "", "before": ""}, "bottom": "", "format": "", "columns": {"label": 12, "wrapper": "", "container": 12}, "content": "G - In-service Withdrawals", "conditions": [], "description": "", "elementName": "Section heading", "elementType": "TEXT", "isMandatory": false, "classification": "STANDARD", "dataDictFieldUI": {"id": null, "label": null, "fieldName": null, "defaultValue": null, "possibleValues": null, "dataDictionaryId": null, "fieldValueFormat": null}}, {"cols": [{"label": "Plan Information", "value": "column_1", "inputType": {"type": "textarea"}}, {"label": "Recommendations", "value": "column_2", "inputType": {"type": "textarea"}}, {"label": "Call Notes", "value": "column_3", "inputType": {"type": "textarea"}}, {"label": "Final Design", "value": "column_4", "inputType": {"type": "textarea"}}], "name": "matrix_6", "rows": 3, "size": "", "type": "matrix", "label": "", "rules": [], "value": [{"column_1": "G - Retirement/Hardship/Age", "column_2": "Hardship withdrawals are allowed from all Accounts except from: (i) the Qualified Non‑Elective Contribution Account, (ii) the Matching Contribution Account to the extent used for safe harbor requirements, and (iii) earnings on the Elective Deferral Account as specified. Hardship criteria follow the Safe Harbor criteria set forth in Section 8.01(b) and are expanded to include the Beneficiary; if permitted from the Elective Deferral Account, Roth Elective Deferral Account withdrawals are allowed on the same terms. In‑service withdrawals based on specified age and service: None, except withdrawals are allowed at age 59‑1/2 for all Accounts.", "column_3": "", "column_4": ""}, {"column_1": "G - Other Withdrawals", "column_2": "In-service withdrawals are permitted from the Rollover Contribution Account at any time as per Section 8.03(b).", "column_3": "", "column_4": ""}, {"column_1": "G - Roth Rollovers and Transfers", "column_2": "The plan permits In-Plan Roth Rollovers and Transfers if Roth contributions are allowed. In-Plan Roth Rollovers are only permitted if the plan allows for distributions or in-service withdrawals. The plan ensures that existing distribution or in-service withdrawal rights are preserved for each account holder under Code section 411(d)(6) protected benefits.", "column_3": "", "column_4": ""}], "addons": {"after": "", "before": ""}, "canAdd": false, "format": "", "colWrap": false, "columns": {"label": 12, "wrapper": "12", "container": 12}, "presets": ["matrix-table"], "rowWrap": false, "disabled": false, "readonly": false, "canRemove": false, "conditions": [], "stickyCols": false, "stickyRows": false, "description": "", "elementName": "Single Choice Matrix", "elementType": "matrix", "isMandatory": false, "hideColLabels": false, "hideRowLabels": false, "classification": "STANDARD", "dataDictFieldUI": {"id": null, "label": null, "fieldName": null, "defaultValue": null, "possibleValues": null, "dataDictionaryId": null, "fieldValueFormat": null}}], "is_mandatory_not_filled": false}, {"is_saved": false, "page_name": "page7", "section_name": "H - Plan Operations, Trust & Top Heavy", "form_elements": [{"tag": "h2", "top": "", "name": "h2", "size": "", "type": "h2", "align": "left", "rules": [], "addons": {"after": "", "before": ""}, "bottom": "", "format": "", "columns": {"label": 12, "wrapper": "", "container": 12}, "content": "H - Plan Operations, Trust & Top Heavy", "conditions": [], "description": "", "elementName": "Section heading", "elementType": "TEXT", "isMandatory": false, "classification": "STANDARD", "dataDictFieldUI": {"id": null, "label": null, "fieldName": null, "defaultValue": null, "possibleValues": null, "dataDictionaryId": null, "fieldValueFormat": null}}, {"cols": [{"label": "Plan Information", "value": "column_1", "inputType": {"type": "textarea"}}, {"label": "Recommendations", "value": "column_2", "inputType": {"type": "textarea"}}, {"label": "Call Notes", "value": "column_3", "inputType": {"type": "textarea"}}, {"label": "Final Design", "value": "column_4", "inputType": {"type": "textarea"}}], "name": "matrix_7", "rows": 2, "size": "", "type": "matrix", "label": "", "rules": [], "value": [{"column_1": "H - Plan Operations", "column_2": "The Plan is restricted from investing in \"qualifying employer securities\" or \"qualifying employer real property.\" All accounts are subject to ERISA section 404(c) regulations. Valuations occur each business day. The Plan Sponsor serves as the Plan Administrator, and both the Plan Administrator and Investment Fiduciary adopt their own procedures. The Investment Fiduciary is the Plan Sponsor, distinct from the Trustee, and standard indemnification procedures according to Section 11.06 are in place.", "column_3": "", "column_4": ""}, {"column_1": "H - Top-Heavy", "column_2": "Top-Heavy allocations under this plan are designated for the plan itself, specifically for non-key employees who are employed by the employer on the last day of the Plan Year. There are no allocations to other plans maintained by the employer. The top-heavy vesting schedule is noted as not applicable, indicating compliance with top-heavy regulations.", "column_3": "", "column_4": ""}], "addons": {"after": "", "before": ""}, "canAdd": false, "format": "", "colWrap": false, "columns